import React, { useEffect, useState } from 'react'
import axios from 'axios'

const Monitor = () => {
  
    const [data,setData] = useState();

    useEffect(()=>{
        axios.get("https://api.datadoghq.com/api/v1/monitor").then((resp)=>{
            setData(resp.data)
            console.log(resp.data);
        })
    },[])

    return (
    <div>
        Monitor
    </div>
  )
}

export default Monitor
